(10, 1, 'ANC members to visit Zuma in Nkandla to officially welcome him home', , 'Senior ANC members in former president Jacob Zumaâ€™s Nkandla village will on Tuesday hold a rally to officially welcome him home from prison.\r\n\r\nEarlier this month Zuma was placed on medical parole after serving a portion of his 15-month sentence imposed on him by the Constitutional Court after he defied its order to appear before the Zondo Commission.\r\n\r\nHe arrived in Nkandla a few days ago.', '2021-09-29 06:52:14');
INSERT INTO `newsfeed` (`news_id`, `staff_id`, `heading`, `image`, `content`, `date`) VALUES
(11, 1, 'IEC worker accuses Pietermaritzburg ANC candidate councillor of threatening her', , 'An Electoral Commission (IEC) worker in Imbali has accused a Pietermaritzburg ANC ward councillor candidate of threatening her life when he verbally attacked her at the weekend.\r\n\r\nThe incident is said to have happened on Saturday during voter registration for the November municipal elections.\r\n\r\nAccording to the woman, who asked not to be named for fear of victimisation, she was working as a voting district co-ordinator at one of the voting stations when the candidate, whose name is known to The Witness, started hurling insults at her.\r\n\r\n', '2021-09-29 06:52:14');
INSERT INTO `newsfeed` (`news_id`, `staff_id`, `heading`, `image`, `content`, `date`) VALUES
(12, 1, 'WEATHER WARNING | Widespread showers and thundershowers expected in KZN for rest of the week', , 'SAWS said widespread showers and thundershowers can be expected over the southern and western parts of the province from Wednesday and will continue into Thursday.\r\n\r\nThe areas expected to be affected include Abaqulusi, Alfred Duma - Indaka, Alfred Duma - Ladysmith, Dannhauser, Dr N. Dlamini-Zuma - Underberg, eDumbe, eMadlangeni, Endumeni, eThekwini, Greater Kokstad, Impendle, Ingwe, Inkosi Langalibalele - Estcourt, Inkosi Langalibalele - Sobabili, M_Ethekwini, Mkhambathini, Mpofana - Giants Castle, Mpofana - Mooi River, M_Ray Nkonyeni, Msinga, M_Umdoni, Newcastle, Nquthu, Okhahlamba, Ray Nkonyeni, Richmond, The Msunduzi, Ubuhlebezwe, Umdoni, uMngeni, uMshwathi, UMuziwabantu, Umvoti, Umzimkhulu and Umzumbe.\r\n\r\nMild to heavy rain is expected until Wednesday next week.\r\n\r\nSAWS said localised flooding of susceptible settlements, both formal and informal, roads, low lying areas, and low-lying bridges is possible.\r\n\r\nPeople have been urged to stay indoors and off roads if possible.', '2021-09-29 06:52:14');
INSERT INTO `newsfeed` (`news_id`, `staff_id`, `heading`, `image`, `content`, `date`) VALUES
(13, 1, 'â€˜No jab, no alcoholâ€™ suggestion rejected by traders', , 'Alcohol traders are unhappy with talks that they should refuse to sell alcohol to unvaccinated customers.\r\n\r\nLimpopo Health MEC Phophi Ramathuba, said this week that she was holding discussions with liquor traders in the province about refusing to sell alcohol to unvaccinated customers.\r\n\r\nMusawenkosi Khawula, who owns a bottle store and tavern in Pietermaritzburg, told Weekend Witness that Ramathubaâ€™s request was ridiculous.\r\n\r\n', '2021-09-29 06:52:14');

